var title_f11_27_11707="Causes and diagnosis of tall R waves in V1";
var content_f11_27_11707=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=CARD%2F72039&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=CARD%2F72039&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Causes and diagnosis of tall R waves in V1",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        Diagnosis",
"       </td>",
"       <td class=\"subtitle1\">",
"        Confirmatory clues",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        True posterior infarct",
"       </td>",
"       <td>",
"        ST &darr;, T &uarr; in V1-V2; Q waves and ST",
"&uarr; V7-V9",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Right ventricular hypertrophy",
"       </td>",
"       <td>",
"        RAD; RAE; secondary ST-Ts; V7-V9 normal",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Ventricular septal hypertrophy",
"       </td>",
"       <td>",
"        Associated Q waves; LVH; V7-V9 normal or deep narrow Q",
"waves",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Right bundle branch block",
"       </td>",
"       <td>",
"        Wide QRS; broad S in V1, V6; R peaks late in V1; V7-V9",
"normal or broad S waves",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Wolff-Parkinson-White syndrome",
"       </td>",
"       <td>",
"        Short PR; delta wave; V7-V9 normal or delta wave",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Normal variant",
"       </td>",
"       <td>",
"        No other abnormalities",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     LVH: left ventricular hypertrophy; RAD: right-axis deviation; RAE: right atrial enlargement.",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
