var title_f11_27_11708="Checklists for alcohol use and dependence";
var content_f11_27_11708=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PSYCH%2F82740&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=6\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PSYCH%2F82740&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=6\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Checklists for alcohol use and dependence",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Checklist for alcohol abuse*",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_single\">",
"        Determine whether, in the past 12 months, your patient's drinking has repeatedly caused or contributed to...",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Risk of bodily harm (eg, drinking and driving, operating machinery, swimming)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Relationship trouble (family or friends)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Role failure (interference with home, work, or school obligations)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Run-ins with the law (arrests or other legal problems)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Checklist for alcohol dependence",
"        <sup>",
"         &bull;",
"        </sup>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_single\">",
"        Determine whether, in the past 12 months, your patient has...",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Not been able to stick to drinking limits (repeatedly gone over them)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Not been able to cut down or stop (repeated failed attempts)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Shown tolerance (needed to drink a lot more to get the same effect)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Shown signs of withdrawal (tremors, sweating, nausea, or insomnia when trying to quit or cut down)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Kept drinking despite problems (recurrent physical or psychological problems)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Spent a lot of time drinking (or anticipating or recovering from drinking)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Spent less time on other matters (activities that had been important or pleasurable)",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     * One symptom indicates abuse.",
"     <br>",
"      <span class=\"bullet\">",
"       &bull;",
"      </span>",
"      Three symptoms indicate dependence.",
"     </br>",
"    </div>",
"    <div class=\"reference\">",
"     Reproduced from: National Institute on Alcohol Abuse and Alcoholism. Helping Patients Who Drink Too Much: A Clinician's Guide, 2nd ed, National Institutes of Health, Bethesda, MD 2007.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
