var title_f11_27_11709="DSM-IV-TR criteria for ADHD";
var content_f11_27_11709=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PSYCH%2F50326&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PSYCH%2F50326&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    DSM-IV-TR criteria for attention deficit hyperactivity disorder",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Presence of either 1 or 2",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_single\">",
"        1. Six (or more) of the following symptoms of inattention have persisted for at least six months to a degree that is maladaptive and inconsistent with developmental level:",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Often fails to give close attention to details or makes careless mistakes in schoolwork, work, or other activities",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Often has difficulty sustaining attention in tasks or play activities",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Often does not seem to listen when spoken to directly",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Often does not follow through on instructions and fails to finish schoolwork, chores, or duties in the workplace (not due to oppositional behavior or failure to understand instructions)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Often has difficulty organizing tasks and activities",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Often avoids, dislikes, or is reluctant to engage in tasks that require sustained mental effort (such as schoolwork or homework)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Often loses things necessary for tasks or activities (eg, toys, school assignments, pencils, books, or tools)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Is often easily distracted by extraneous stimuli",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Is often forgetful in daily activities",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_single\">",
"        2. Six (or more) of the following symptoms of hyperactivity-impulsivity have persisted for at least six months to a degree that is maladaptive and inconsistent with developmental level:",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist2_start\">",
"        Hyperactivity",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist2\">",
"        Often fidgets with hands or feet or squirms in seat",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist2\">",
"        Often leaves seat in classroom or in other situations in which remaining seated is expected",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist2\">",
"        Often runs about or climbs excessively in situations in which it is inappropriate (in adolescents or adults, may be limited to subjective feelings of restlessness)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist2\">",
"        Often has difficulty playing or engaging in leisure activities quietly",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist2\">",
"        Is often \"on the go\" or often acts as if \"driven by a motor\"",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist2\">",
"        Often talks excessively",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist2_start\">",
"        Impulsivity",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist2\">",
"        Often blurts out answers before questions have been completed",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist2\">",
"        Often has difficulty awaiting turn",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"sublist2\">",
"        Often interrupts or intrudes on others (eg, butts into conversations or games)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Additional criteria",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Some hyperactive-impulsive or inattentive symptoms that caused impairment were present before age seven years.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Some impairment from the symptoms is present in two or more settings (eg, at school [or work] and at home).",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        There must be clear evidence of clinically significant impairment in social, academic, or occupational functioning.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        The symptoms do not occur exclusively during the course of a pervasive developmental disorder, schizophrenia, or other psychotic disorder and are not better accounted for by another mental disorder (eg, mood disorder, anxiety disorder, dissociative disorder, or a personality disorder).*",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     * In children and adolescents it it also important to exclude other medical or situational conditions that could account for the symptoms (see text for details). However, this is not a Diagnostic and Statistical Manual criterion.",
"    </div>",
"    <div class=\"reference\">",
"     Footnote added for this publication. Reprinted with permission from the Diagnostic and Statistical Manual of Mental Disorders, Fourth Edition, Text Revision (Copyright &copy; 2000). American Psychiatric Association.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
